import React from "react";
import {
  CarouselProvider,
  Slider,
  Slide,
  ButtonBack,
  ButtonNext,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";

import Mycard from "./productCard.js";

import "./productCarousel.css";

const Imagecarousel = () => {
  return (
    <div className="product-carousel">
      <CarouselProvider
        visibleSlides={3}
        totalSlides={6}
        step={3}
        naturalSlideWidth={400}
        naturalSlideHeight={500}
      >
        <div className="product-container">
          <Slider className="slider">
            <Slide index={0} style={{ width: "300px" }}>
              <Mycard cardno="1" />.
            </Slide>
            <Slide index={1} style={{ width: "300px" }}>
              <Mycard cardno="2" />
            </Slide>
            <Slide index={2} style={{ width: "300px" }}>
              <Mycard cardno="3" />
            </Slide>
            <Slide index={2} style={{ width: "300px" }}>
              <Mycard cardno="3" />
            </Slide>
            <Slide index={2} style={{ width: "300px" }}>
              <Mycard cardno="3" />
            </Slide>
          </Slider>

          <ButtonBack className="buttonBack">Back</ButtonBack>
          <ButtonNext className="buttonNext">Next</ButtonNext>
        </div>
      </CarouselProvider>
    </div>
  );
};

export default Imagecarousel;
